import React from 'react'

const HomeCard = (props) => {
    return(
        <div className = 'home-card'>
        <div className = 'register-card-icon'>
            <i class={`${props.icon} fill-current text-gray-200`}></i>
        </div>
        <div className = 'register-card-text'>
            <p class = "text-gray-200 font-extrabold font-register-card text-5xl">{props.text}</p>
        </div>
        <div className = "register-card-underline">
            <h1 className = {`${props.color}`}>---------------------------------------------------------</h1>
        </div>
    </div>
    );
}

export default HomeCard;
